import Top from "./components/Top.js";
import Home from "./pages/Home";
import About from "./pages/About.js";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Routes,
  Link
} from "react-router-dom";

import './App.css';

function App() {
  const style = {
    textDecoration:'none',
    marginRight: 10,
    fontSize:25,
    color: 'black'
  };
  return (
    <div className="App">
      <Router>
        <Routes>
          <Link to="/" style={style}>Home</Link>
          <Link to="/About" style={style}>About</Link>
          <Route path="/" index={<Home/>}/>
          <Route path="/About" index={<Home/>}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
